// Generate all the methods
print("// MARK: - Generated API Methods")
print("")

for (swiftName, returnType, paramTypes, cFunction, pattern) in functionPatterns {
    print(generateMethod(swiftName, returnType, paramTypes, cFunction, pattern))
}

func generateMethod(_ name: String, _ returnType: String, _ paramTypes: [String], _ cFunction: String, _ pattern: String) -> String {
    let params = paramTypes.enumerated().map { index, type in
        let paramName = getParamName(type, index: index)
        return "\(paramName): \(type)"
    }.joined(separator: ", ")
    
    let helperCall = generateHelperCall(pattern, cFunction, paramTypes)
    
    return """
    public static func \(name)(\(params)) throws -> \(returnType) {
        return try \(helperCall)
    }
    
    """
}

func getParamName(_ type: String, index: Int = 0) -> String {
    if type.contains("OpaqueRustPointer") {
        let extracted = type.replacingOccurrences(of: "OpaqueRustPointer<", with: "")
            .replacingOccurrences(of: ">", with: "")
        return extracted.lowercased()
    } else if type == "String" {
        return index == 0 ? "input" : "string\(index + 1)"
    } else if type == "Data" {
        return "data"
    } else if type == "Int64" {
        return "value"
    } else if type == "Int32" {
        return "value"
    } else {
        return "param\(index + 1)"
    }
}

func generateHelperCall(_ pattern: String, _ cFunction: String, _ paramTypes: [String]) -> String {
    switch pattern {
    case "string_to_rptr":
        return "callRustFunction(\(cFunction), input: input)"
    case "data_to_rptr":
        return "callRustFunctionWithData(\(cFunction), input: data)"
    case "no_input_to_rptr":
        return "callRustFunctionNoInput(\(cFunction))"
    case "rptr_to_string":
        return "callRustFunctionForString(\(cFunction), input: \(getParamName(paramTypes[0])))"
    case "rptr_to_data":
        return "callRustFunctionForData(\(cFunction), input: \(getParamName(paramTypes[0])))"
    case "rptr_to_bool":
        return "callRustFunctionForBool(\(cFunction), input: \(getParamName(paramTypes[0])))"
    case "rptr_to_int32":
        return "callRustFunctionForInt32(\(cFunction), input: \(getParamName(paramTypes[0])))"
    case "rptr_to_int64":
        return "callRustFunctionForInt64(\(cFunction), input: \(getParamName(paramTypes[0])))"
    case "rptr_to_rptr":
        return "callRustFunctionRPtrToRPtr(\(cFunction), input: \(getParamName(paramTypes[0])))"
    case "two_rptrs_to_rptr":
        return "callRustFunctionTwoRPtrs(\(cFunction), input1: \(getParamName(paramTypes[0])), input2: \(getParamName(paramTypes[1])))"
    case "two_rptrs_to_bool":
        return "callRustFunctionTwoRPtrsForBool(\(cFunction), input1: \(getParamName(paramTypes[0])), input2: \(getParamName(paramTypes[1])))"
    case "two_rptrs_to_int64":
        return "callRustFunctionTwoRPtrsForInt64(\(cFunction), input1: \(getParamName(paramTypes[0])), input2: \(getParamName(paramTypes[1])))"
    case "rptr_and_string_to_string":
        return "callRustFunctionRPtrAndString(\(cFunction), input: \(getParamName(paramTypes[0])), string: string2)"
    default:
        return "// TODO: Handle pattern \(pattern) for \(cFunction)"
    }
}
